async function bench(func: () => Promise<void>) {
    const times = [];

    for (let i = 0; i < 200; i ++) {

        const start = new Date().getTime();
        await func();
        const end = new Date().getTime();

        times.push(end - start);

        await timeout(5_000);

    }

    times.sort((a, b) => a - b);
    const sum = times.reduce((a, b) => a + b, 0);

    console.log("min = " + times[0] + " avg = " + (sum / times.length) + " max = " + times[times.length - 1]);


}

